// RegistrationForm.js
import React, { useState } from 'react';
import "./style.css"

function RegistrationForm({ addUser }) {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    bloodGroup: '',
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    addUser(formData);
    setFormData({ firstName: '', lastName: '', email: '', bloodGroup: '' });
  };

  return (
    <form onSubmit={handleSubmit} className='form' >
      <h2 >Register for Blood Donation</h2>
      <label >
      first Name:
        <input type="text" name="firstName" value={formData.firstName} onChange={handleChange}  />
      </label>
      <br />
      <label >
        Last Name:
        <input type="text" name="lastName" value={formData.lastName} onChange={handleChange}  />
      </label>
      <br />
      <label >
        Mobile:
        <input type="number" name="mobile" value={formData.email} onChange={handleChange}  />
      </label>
      <br />
      <label >
        Blood Group:
        <input type="text" name="bloodGroup" value={formData.bloodGroup} onChange={handleChange}  />
      </label>
      <br/>
      <label >
        location:
        <input type="text" name="loaction" value={formData.loaction} onChange={handleChange}  />
      </label>
      <br />
      <button type="submit" >Submit</button>
    </form>
  );
}


export default RegistrationForm;
